('6', '38', 'Để sắp xếp dữ liệu trong cột theo thứ tự tăng dần, ta chọn lệnh Data - Sort, sau đó chọn:', 'Ascending', 'Descending', 'Sort By', 'Sort Descending', 'B'),
('6', '39', 'Để thực hiện đổi ký tự đầu của mỗi từ trong biểu thức chuỗi thành chữ hoa, các ký tự còn lại trong từ là chữ thường ta sử dụng hàm:', 'Proper()', 'Lower()', 'Upper()', 'Không có lệnh nào đúng', 'A'),
('6', '40', 'Để thực hiện lệnh mở một tập tin hiện có lưu trên đĩa, ta bấm\ntổ hợp phím:', 'Ctrl + O', 'Ctrl + I', 'Ctrl + B', 'Ctrl + E', 'A'),
('6', '41', 'Để thực hiện phân trang tại dòng dữ liệu đang chọn cho bảng tính hiện hành thì ta thực hiện:', 'View - Page Break', 'Insert - Worksheet', 'Insert - Rows', 'Insert - Page Break', 'D'),
